import React from 'react';
import axios from 'axios';

const Transaction = ({ bus }) => {
  const handleBooking = () => {
    const transactionModel = {
      numberPlate: bus.numberPlate,
      source: bus.source,
      destination: bus.destination,
      startingTime: bus.startingTime,
      noOfPassenger: 1, // Assuming one passenger for now
      transactionId: 0, // Assign a valid transaction ID if required
      tripDate: '', // Set the trip date if required
      email: '', // Set the email if required
      passengerList: [], // Add passenger details if required
    };

    axios
      .post('http://localhost:8090/maketransaction', transactionModel)
      .then((response) => {
        // Handle the response from the transaction endpoint
        console.log('Transaction successful:', response.data);
      })
      .catch((error) => {
        // Handle errors if the transaction fails
        console.error('Transaction failed:', error);
      });
  };

  return (
    <button className="btn btn-primary" onClick={handleBooking}>
      Book
    </button>
  );
};

export default Transaction;
